This is me. Boots, bourbon, fly fishing, horses, nature and family. In no certain order. This is me sitting in beautiful Colorado getting some much needed perspective while gazing at this beautiful and lyrical landscape from a porch swing, knee deep in a stream, or a saddle on a majestic American horse. Casting my flyrod in these beautiful rivers and streams fished by the indigenous peoples who thrived and nurtured this land for thousands of years. Thinking about the awe settlers who came before me must have experienced. 

Getting back to natural world is the only way for me to get back to the nature of who I truly am‚Ä¶ I have a feeling that‚Äôs true for most of us‚Ä¶

Driving through this beautiful place and being able to pick up a few bottles of my @brothersbondbourbon to share with my old man and my big brother was nothing short of a dream come true. Thank you Colorado for caring so much about your land and thank you so very much for the support of our little company. What A dream it has been to sip my whiskey out of a flask on mountain slopes with my dad and my big brother. 

The most magical Father‚Äôs Day gift from my beautiful wife @nikkireed . Thank you honey for these memories I will never forget‚Ä¶ ‚ù§Ô∏è

