@genesfinefoods  and the amazing restaurants/bars/hotels for serving us. It brings me such great pride to see our bottles on these beautiful bar shelves. It drives me to do more each day at every touch point. MOST importantly we thank YOU- our customers. Wow.  A huge thank you and love to our @wheelsup family for getting us where we need to go safely with smiles and laughter all the way-we couldn‚Äôt do it without you! Thank you for making it so easy and safe.  Thank you @textronaviation @beechcraft for building these amazing machines that so efficiently move us around. The love, gratitude, appreciation and awe I have for you @textronaviation for making us safe is huge. 

We are working so hard to build a truly responsible, regenerative, innovative and absolutely fun company. Life is about experiences and we want to help make them happen.

Rather than just post pictures from the trip I wanted to give you a tiny glimpse into early mornings and evenings of popping around this great state, passionately spitting out ideas and loving creating this brand for you. We. Never. Stop. The ladies crushing it in the front of the plane and the boys crushing it in the back. Checklists, innovating, pushing ourselves to do better every minute. 

Thank you for giving us this opportunity we can‚Äôt thank you enough Northern California! Lots of signed bottles at these retailers in the Northern California area! Go grab them! 

