Want to feel inspired? Want some hope? Want some light in your heart and your household? Want to see how we can reverse climate change, save ourselves and build a bright future for us all AND our children? Give yourself and your family the gift of HOPE this holiday season. Please watch our film @kissthegroundmovie on @netflix STREAMING NOW. If you do anything, please take the 35 seconds of your time to look at this short post & powerful publications our film has been reviewed by. Then see the film. Curl up on the couch with the family and or friends. THIS IS YOUR TIME TO CHANGE HISTORY. No politics. No special interests groups. Just families, farmers and consumers. Be inspired. Please watch our film and share your experience. This film is the light at the end of the tunnel that‚Äôs NOT a train coming us. Please.
Thank you from the bottom of my heart.
Ian  @kissthegroundmovie

