Me in Zimbabwe 2011. 9 years ago we ended capturing the first footage of the LIFE-CHANGING FILM: KISS THE GROUND aka @kissthegroundmovie OUT NOW ON @netflix . Please watch our film this weekend. Cuddle up on the couch with the family.  We set out to capture on film the promise, action and steps for regenerating our planet to stop climate change, build a bountiful global food system, halt conflict and flourish. Africa changed my life. This film changed my life. Allan Savory changed my life. It WILL CHANGE YOURS. Seeing the WIDESPREAD AND DEVASTATING effects of human mismanagement of land turning to desert was heartbreakingly. Then seeing the REGENERATIVE effects of a lifetime of research, trial, error, failure and triumph of Allan‚Äôs contribution to humanity was my ‚Äúahh ha‚Äù moment. Living in an old military tent in the Bush, being so close to nature is amazing but  seeing the land and wildlife in peril is hard. Knowing there is a solution is life changing! Will you please share this and watch our film?  @kissthegroundmovie 
